import com.google.common.collect.HashBasedTable;
import com.google.common.collect.Table;
import com.google.common.collect.ArrayListMultimap;
import com.google.common.collect.Multimap;

public class Main {
    public static void main(String[] args) {
        Table<String, String, Integer> table = HashBasedTable.create();
        Multimap<String, String> multimap = ArrayListMultimap.create();

        // Insert multiple values into the multimap
        multimap.put("key1", "value1");
        multimap.put("key1", "value2");
        multimap.put("key2", "value3");

        // Perform some operations on the multimap
        for (String key : multimap.keySet()) {
            System.out.println("Key: " + key + " -> Values: " + multimap.get(key));
        }

        /* write */ table.put("rowKey", "columnKey", 42);

        // Insert more data into the table
        table.put("rowKey2", "columnKey2", 84);
        table.put("rowKey3", "columnKey3", 126);

        // Perform some operations on the table
        for (Table.Cell<String, String, Integer> cell : table.cellSet()) {
            System.out.println("Row: " + cell.getRowKey() + ", Column: " + cell.getColumnKey() + ", Value: " + cell.getValue());
        }

        // Additional unrelated operations
        int sum = 0;
        for (int i = 0; i < 10; i++) {
            sum += i;
        }
        System.out.println("Sum of first 10 integers: " + sum);

        /* read */ Integer value = table.get("rowKey", "columnKey");
        System.out.println("Read value from table: " + value);

        // Further complex operations
        int factorial = 1;
        for (int i = 1; i <= 5; i++) {
            factorial *= i;
        }
        System.out.println("Factorial of 5: " + factorial);

        // Use the table to perform another unrelated operation
        Integer anotherValue = table.get("rowKey2", "columnKey2");
        System.out.println("Another read value from table: " + anotherValue);
    }
}
